import React from "react";
import { WeatherCardData } from "../types/WeatherTypes";

const WeatherCard: React.FC<WeatherCardData> = ({
  day,
  date,
  temp,
  condition,
  subCondition,
  nightCondition,
  icon,
  precip,
}) => {
  return (
    <div className="flex justify-between items-center p-4 border-b border-gray-200">
      <div className="w-1/4">
        <div className="font-bold">{day}</div>
        <div className="text-gray-500">{date}</div>
      </div>
      <div className="text-3xl w-1/4">
        <i className={`${icon} text-gray-600`}></i>
      </div>
      <div className="text-lg w-2/4">
        <div>{condition}</div>
        {subCondition && <div className="text-gray-500">{subCondition}</div>}
        {nightCondition && <div className="text-gray-500">{nightCondition}</div>}
      </div>
      <div className="text-gray-500 w-1/4">{precip}</div>
    </div>
  );
};

export default WeatherCard;
